SELECT NATION.N_REGIONKEY, PARTSUPP.PS_SUPPKEY, SUPPLIER.S_NAME FROM NATION JOIN SUPPLIER ON SUPPLIER.S_NATIONKEY=NATION.N_NATIONKEY JOIN PARTSUPP ON PARTSUPP.PS_SUPPKEY=SUPPLIER.S_SUPPKEY WHERE NATION.N_NAME >= '1998-03-10' AND SUPPLIER.S_ADDRESS < '9SQ4BBH2FQEMAFOOCY45SRTXO6YUOG' AND NATION.N_NAME <= '72503.62' AND NATION.N_REGIONKEY > 14358;
